css:
@-moz-document domain(vozforums.com) {

.tcat, [style*="bottom-width:0"] * {background: #C175C1}
.tfoot, .thead, .pagenav .vbmenu_control, [style="padding:1px; border-top-width:0px"] *,.panelsurround {background: #A349A4} .alt2 , .panel {background: #FFD9E6}
[id^="post_message"], [id^="post_message"] + DIV  {color: #A349A4}
A[href], TABLE .smallfont   {color:#A349A4 ; font-weight:bold}
.alt1, .alt1Active {background: #FFF5F4}

[alt="View Announcement"], [alt="View Post"] , [alt="Go to last post"] {
background: url(data:image/jpeg;base64,) ;
width: 12px; padding-top: 12px ; height: 0 
}

[alt="Reply With Quote"] {
background: url(data:image/jpeg;base64,);
width: 70px; padding-top: 22px ; height: 0 
}

[alt="Multi-Quote This Message"] {
background: url(data:image/jpeg;base64,);
width: 25px; padding-top: 22px ; height: 0 
}

[alt="Quick reply to this message"] {
background: url(data:image/jpeg;base64,);
width: 25px; padding-top: 22px ; height: 0 
}

[alt="Reply"] {
background: url(data:image/gif;base64,);
width: 110px; padding-top: 26px ; height: 0 
}

[alt="View First Unread"] {
background: url(data:image/gif;base64,);
width: 12px; padding-top: 12px ; height: 0 
}

[alt="Old"] {
background: url(data:image/gif;base64,);
width: 10px; padding-top: 11px ; height: 0 
}

[alt="Edit/Delete Message"] {
background: url(data:image/gif;base64,);
width: 70px; padding-top: 22px ; height: 0 
}

[alt="Go Back"] , [src$="navbits_start.gif"] {
background: url(data:image/gif;base64,);
width: 15px; padding-top: 15px ; height: 0 
}

[alt="Reload this Page"] {
background: url(data:image/gif;base64,);
width: 30px; padding-top: 15px ; height: 0 
}

[alt="Post New Thread"] {
background: url(data:image/gif;base64,);
width: 110px; padding-top: 26px ; height: 0 
}

[alt="Announcement"] {
background: url(data:image/gif;base64,);
width: 18px; padding-top: 18px ; height: 0 
}

[alt="Reverse Sort Order"], [alt="Go to first new post"]   {
background: url(data:image/gif;base64,);
width: 12px; padding-top: 12px ; height: 0 
}

[alt="Sticky Thread"] {
background: url(data:image/gif;base64,);
width: 12px; padding-top: 12px ; height: 0 
}


[alt*="Attachment(s)"]{
background: url(data:image/gif;base64,);
width: 7px; padding-top: 13px ; height: 0 
}

[alt*="Deleted Post(s)"]{
background: url(data:image/gif;base64,);
width: 11px; padding-top: 13px ; height: 0 
}

[alt*="is offline"] {
background: url(data:image/gif;base64,);
width: 15px; padding-top: 15px ; height: 0 
}

[src$="forum_old.gif"]  {
background: url(data:image/gif;base64,);
width: 29px; padding-top: 29px ; height: 0 
}

[src$="forum_new.gif"]  {
background: url(data:image/gif;base64,);
width: 29px; padding-top: 29px ; height: 0 
}

[src$="collapse_thead.gif"]  {
background: url(data:image/gif;base64,);
width: 13px; padding-top: 13px ; height: 0 
}

[src$="collapse_thead_collapsed.gif"]  {
background: url(data:image/gif;base64,);
width: 13px; padding-top: 13px ; height: 0 
}
}
